import logo from './logo.svg';
import './App.css';
function Hearder(){
  return <header>
          <h1><a href="/">WEB</a></h1>
        </header>
}
function App() {
  return (
    <div>
      <Hearder></Hearder>
      <nav>
        <ol>
          <li><a href="/read/1">HTML</a></li>
          <li><a href="/read/2">CSS</a></li>
          <li><a href="/read/3">JS</a></li>
        </ol>
      </nav>
      <article>
        <h2>Welcome</h2>
        Hello, WEB!
      </article>
    </div>
  );
}

export default App;
